/** @jsx jsx */

import { Component } from 'react';
import { jsx, css } from '@emotion/core';

import DunderMifflin from 'assets/dundermifflin.png';
import Construction from 'assets/under-construction.gif';

const faqStyle = css`
  padding: 10px;
  text-align: center;
  h2,
  h3 {
    color: black;
    font-family: Helvetica, sans-serif;
    font-weight: bold;
  }
`;

export default class PageFAQ extends Component {
  render() {
    return (
      <div className="PageFAQ" css={faqStyle}>
        <h2>Under Construction</h2>
        <br />
        <img
          src={DunderMifflin}
          style={{ width: '200px' }}
          alt="DunderMifflin"
        />
        <br />
        <br />
        <img src={Construction} style={{ width: '200px' }} alt="Construction" />
        <h3>
          Coming
          <span style={{ color: 'red' }}> C</span>
          <span style={{ color: 'green' }}>h</span>
          <span style={{ color: 'red' }}>r</span>
          <span style={{ color: 'green' }}>i</span>
          <span style={{ color: 'red' }}>s</span>
          <span style={{ color: 'green' }}>t</span>
          <span style={{ color: 'red' }}>m</span>
          <span style={{ color: 'green' }}>a</span>
          <span style={{ color: 'red' }}>s</span>
          <span style={{ color: 'green' }}> 2</span>
          <span style={{ color: 'red' }}>0</span>
          <span style={{ color: 'green' }}>0</span>
          <span style={{ color: 'red' }}>2!</span>
        </h3>
        <br />
        <div>(Still working on it!)</div>
      </div>
    );
  }
}
